import React from "react";
import Heading from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes"

function createNotes(notes) {
  return (
    <Note
      key={notes.id}
    />
  )
}

function App() {
  return (
    <div>
      <Heading/>
      <Note/>
      <Footer/>
    </div>
  );
}

export default App;
